import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fab } from '@fortawesome/free-brands-svg-icons';
const fas  = React.lazy(() => import('@fortawesome/free-solid-svg-icons').then(module => ({ default: module.fas })));
// .then(module => ({ default: module.OtherComponent }))

export const Facebook = props => {
    return (
        <FontAwesomeIcon icon={fab.faFacebookSquare}/>  
    )
}

export const LeftArrow = props => {
    return (
        <FontAwesomeIcon icon={fas.faArrowLeft}/>
    )
}
